import React from 'react';
import {
  WelcomeSectionContainer,
  WelcomeBg,
  VideoBg,WelcomeContent,WelcomeTitle,WelcomeP,WelcomeBtnWrapper,ArrowForward,ArrowRight
} from './WelcomeSectionStyle';
import Video from '../../videos/video.mp4';

const welcomeSection = () => {
  return (
    <WelcomeSectionContainer>
      <WelcomeBg>
        <VideoBg autoPlay loop muted src={Video} type='/video/mp4' />
      </WelcomeBg>
      <WelcomeContent>
          <WelcomeTitle>Zokko Digital Web Agency</WelcomeTitle>
          <WelcomeP>
              Sign up today and receive $150 voucher to your next project
          </WelcomeP>
          <WelcomeBtnWrapper>
              <Button to='signup'>
                  Get Started {hover ? <ArrowForward/> : <ArrowRight/>}
              </Button>
          </WelcomeBtnWrapper>
      </WelcomeContent>
    </WelcomeSectionContainer>
  );
};

export default welcomeSection;
